    e = bin(a)[2:]
    f = 1
    p = 1
    while b != 0:
        f += p * (b % 10)
        p *= 2
        b //= 10
    g = hex(c)[2:].upper()
    p = 1
    m = {'A': 10, 'B': 11, 'C': 12, 'D': 13, 'E': 14, 'F': 15}
    d = d[::-1]
    h = 0
    for i in d:
        if i.isdigit():
            h += int(i) * p
        else:
            h += p * m[i]
        p *= 16
    return [e, str(f), g, str(h)]

